import React, { Component } from 'react';

import "react-responsive-carousel/lib/styles/carousel.min.css";
import { Carousel } from 'react-responsive-carousel';

import '../../Styles/Artist.css';

import bub from '../../../../Assets/art/OC/Bubbub_.png';
import bubble from '../../../../Assets/art/OC/bubble.png';
import lion from '../../../../Assets/art/OC/Lion.png';
import robo from '../../../../Assets/art/OC/Robo.png';
import animated from '../../../../Assets/art/OC/Animated.gif';

class One extends Component {
    state = {  } 
    render() { 
        return (
            <div className='whole' id = "experienceArt">

                <p id = "title">Experience</p>
                <p id = "paragraph">My passion of art has been around since I was around 9 years old. From sixth grade til the end of high school, I was enrolled
                into Talented Art classes, <span>an accelerated curriculum based on the National Standards for Arts Education</span> 
                . My skills and experience range from catoon to realism art style. Currently, my main medium is digital art with an anime-inspired art style. </p> 

            <p id = "link">Since 2009</p>


            <div className='wholeCD'>

                <div className='characterDesignDesc col-lg-5'>
                    <p id = "title">Character Design</p>
                    <p id = "paragraph"></p>
                </div>
                <div className='OCGallery col-lg-4'>
                            <Carousel
                            autoPlay = {true}
                            infiniteLoop = {true}>

                                <img id = "OCimage" src= {bubble} />
                                <img id = "OCimage"  src= {bub} />
                                <img id = "OCimage"  src= {lion} />
                                <img id = "OCimage"  src= {robo} />
                                <img id = "OCimage"  src= {animated} />

                            </Carousel>
                </div>

            </div>


            </div>


        );
    }
}

export default One;
